import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";


const Courses=()=>{
       
 return(   
          <>
            <div className="container">
    <div className="row my-5">
<div className="col-md-4">
    {Sdata.map((val)=>{
   return(
       <Card
       imgsrc={val.imgsrc}
       title={val.title}
       />
   )
   })
   }
   </div>

</div>
</div>   
   </>
   )
  

    
} ;

export default Courses;
